    components: {},
    template: `
<div>
    <div  v-if="reload" :class="propGrille.id + ' grid-stack grid grid-stack-12 ' + propGrille.id"> 
        <div v-for="widget in widgets" class="grid-stack-item itemGrid" :data-gs-x="widget.x" :data-gs-y="widget.y" :data-gs-width="widget.w" :data-gs-height="widget.h">
            <div class="grid-stack-item-content"><div v-html="widget.content"></div></div>
        </div>
    </div>
    <div v-if="!reload"><div class="loaderHeader"><div style="" class="lds-roller"><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div></div></div></div>

</div>
`,

    methods: {
        async calHeightTabs() {
            this.mobile = window.matchMedia("(min-width:1100px)").matches;
            var options = {
                timeoutCalculHeight: 200,
                mobileDesign: this.mobile,
                gridId: this.propGrille.id
            };
            let { default: EventBus } = await import(AddUrlTimeStampJS("../../bus/event-bus.js"));
            EventBus.$emit('timeOutRightNav', options);
        },
        creatGrid(ctx) {
            let that = this
            let optionsGrille = {
                float: true,
                width: 12,
                height: 0,
                animate: true,
                alwaysShowResizeHandle: true,
                cellHeight: 130,
                verticalMargin: 10,
                horizontalMargin: 10,
                placeholderClass: 'grid-stack-placeholder',
                acceptWidgets: '.grid-stack-item'
            };

            setTimeout(function () {
                that.reload = true;

                Vue.nextTick(() =>
                    that.grid = $('.grid-stack.' + that.propGrille.id).gridstack(_.defaults(optionsGrille))
                );

                Vue.nextTick(() =>
                    $('.grid-stack.' + that.propGrille.id).on('gsresizestop', function (event, elem) {
                        that.calHeightTabs(event, elem)
                    })
                );

                Vue.nextTick(() =>
                    $('.grid-stack.' + that.propGrille.id).on('dragstop', function (event, ui) {
                        that.calHeightTabs(event, ui)
                    })
                );
            }, 500);
        }
    },
    mounted() {
        //this.creatGrid()
    },

